import BubbleBox from "../Presenter/BubbleBox";
import { Name, Date, Content } from "../Presenter/InBubble";
import styled from "styled-components";

const MyName = styled(Name)`
    position: absolute;
    right: 40px;
`

const MyBubbleContainer = () => {

    return (
        <BubbleBox>
            <MyName>이상철</MyName>
            <Date>5:23 PM</Date>
            <Content>안녕하세요 여러분~!</Content>
        </BubbleBox>
    )
}

export default MyBubbleContainer;
